[general]
context=from-trunk-other
allowguest=yes
allowoverlap=no
;allowtransfer=no
bindport=5060
bindaddr=0.0.0.0
srvlookup=yes
maxexpiry=3600
minexpiry=20
defaultexpiry=60
disallow=all
allow=g729,gsm,alaw,ulaw,g723,h264,h263
language=cn
progressinband=never
useragent=Freeiris2 Opensource Telephony Project
; video
videosupport=yes
maxcallbitrate=384
;
callevents=yes
;rtp keep
;rtptimeout=60
;rtpholdtimeout=300
;rtpkeepalive=<secs>
;----------------------------------------- SUBSCRIBE HINTS SUPPORT -----------------------
;allowsubscribe=no
;subscribecontext = default
;notifyringing = yes
;notifyhold = yes
limitonpeers = yes
;----------------------------------------- T.38 FAX PASSTHROUGH SUPPORT -----------------------
t38pt_udptl = yes            ; Default false
;----------------------------------------- NAT SUPPORT ------------------------
;externip = 200.201.202.203
;externhost=foo.dyndns.net
;externrefresh=10
;localnet=169.254.0.0/255.255.0.0 ;Zero conf local network
nat=no
;----------------------------------- MEDIA HANDLING --------------------------------
canreinvite=no
;directrtpsetup=yes
;------------------------------ JITTER BUFFER CONFIGURATION --------------------------
; jbenable = yes
; jbforce = no
; jbmaxsize = 200
; jbresyncthreshold = 1000
; jbimpl = fixed
; jblog = no


#include sip_regfile.conf
#include sip_exten.conf
#include sip_trunk.conf

[1000]
type=friend
username=1000
accountcode=1000
secret=1000
context=from-exten-sip
;followed advance settings
host=1000
nat=1000
qualify=1000
canreinvite=1000
callgroup=1000
pickupgroup=1000
setvar=1000
call-limit=1000

